import React from 'react';
import styled from 'styled-components';

//logo
import logo from '../assets/PneuS-03.png'

//icons
import {GiPhone} from 'react-icons/gi'
import {MdMail} from 'react-icons/md'

const Styles = styled.div`
display:flex;
flex-direction:column;
align-items:center;
height:40vh;
font-size:16px;
.presentation{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    background-color:#eee;
    width:100%;
    height:30%;
    padding: 2% 0;
}
.coordonnee{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    width:100%;
    height:70%;
    padding: 2% 5%;
}
`;
function underHeader() {
    return(
        <React.Fragment>
            <Styles>
                <div className='presentation'>
                   <img
                        src={logo}
                        width="120"
                        height="50"
                        className="logo"
                        alt="Logo Pneu service"
                    />
                    <p style={{fontSize:'1.3em', fontWeight:'500', color:'#555'}}>Leader de la vente en ligne des pneus multimarque en Alg√©rie.</p>
                </div>
                <div className='coordonnee'>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'></div>
                        <div className='card-col-2'></div>
                    </div>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'></div>
                        <div className='card-col-2'></div>
                    </div>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'></div>
                        <div className='card-col-2'></div>
                    </div>
                </div>
            </Styles>
        </React.Fragment>
    )
}

export default underHeader;
